import React, { useEffect, useState } from "react";
import Image from "next/image";

interface ImageBlobProps{
    quoteReceived: String | null;
    bloUrl: String | null;
}
const ImageBlob = ({
    quoteReceived,
    //bloUrl
}: ImageBlobProps)=>{

    const [bloUrl, setBloUrl] = useState<string | null>(null);

    useEffect(() => {
        const response ={
            "statusCode": 200,
            "header": {
                "Content-type": "image/png",
                "Access-Control-Allow-Origin": "*"
            },
            "body": 
            "",
            "isBase64Encode": true,
       }
       const binaryData = Buffer.from(response.body, 'base64');
       const blob = new Blob([binaryData], { type: response.header["Content-type"]});
       const newBloUrl = URL.createObjectURL(blob);
       setBloUrl(newBloUrl);
       return ()=>{
            URL.revokeObjectURL(newBloUrl);
       }
    }, []);

    if(!bloUrl){
        return null;
    }

    return(

        <Image src={bloUrl} alt="Generated quote card" width={150} height={100} />
    );
        
    
}

export default ImageBlob;